function App() {
  return (

      <div className="max-w-sm rounded overflow-hidden shadow-lg mt-auto mx-auto">
        <img
          className="w-full"
          src="/images/trek.jpg"
          alt="Trekking View"
        />
        <div className="px-6 py-4">
          <div className="font-bold text-xl mb-2">The Coldest Sunset</div>

        </div>
        <div className="px-6 pt-4 pb-2">

        </div>
      </div>

  );
}

export default App;
